import ExpenseItem from "./ExpenseItem"
import './Expenses.css'
function Expenses(props) {
    return (
        <div>
            {
                props.items.map(item => {
                    return (
                        <ExpenseItem key={item.id} date={item.date} name={item.name} price={item.price}></ExpenseItem>
                    )
                })
            }
        </div>
    )
}
export default Expenses;
